import { TextField } from "@mui/material";
import React from "react";
import "./App.css";

function App() {
  return <div className="App">
  <TextField
  id="outlined-read-only-input"
  label="Read Only"
  defaultValue="Hello World"
  InputProps={{
    readOnly: true,
  }}
/>
  ></div>;
}

export default App;
